			(function() {
				'use strict';
				
				angular
				.module('web')
				.controller('SearchResultsController', SearchResultsController);
				
				/* @ngInject */
				function SearchResultsController($scope, $state, data, config, utils) {
					var vm = this;
					vm.searchQuery = $state.params.query || '';
					vm.searchBy = $state.params.by || '';
					vm.searchVariants = {
						users: [],
						games: [],
						counts: {
							users: 0,
							games: 0
						}
					};
					vm.resultsAreLoading = false;
					vm.scrollFetchEnabled = true;
					vm.showLiveViewerCounts = config.showLiveViewerCounts;
					var page = 0;
					vm.search = search;
					vm.selectSearchMatch = selectSearchMatch;
					vm.select = select;
					
					vm.tabs = [
					{
						title: 'Users',
						active: false,
						url: 'users'
					}, 
					{
						title: 'Games',
						active: false,
						url: 'games'
					}
					];
					var RESULTS_LIMIT = 50;
					
					activateTab();
					// if first loading pass type = null to search, if second (next piece of data by infinity scroll) pass type = user/game
					search(null );
					
					function selectSearchMatch(item, type) {
						switch (type) {
						case 'game':
							$state.go('game', {
								game: item.lowerUrl
							});
							$scope.$emit('search', vm.searchQuery, 'Game', item.name);
							break;
						case 'user':
							$state.go('channel', {
								channel: item.primaryChannel.lowerUrl
							});
							$scope.$emit('search', vm.searchQuery, 'User', item.username);
							break;
						}
					}
					
					function select(type) {
						// start from second page cuz initial piece of data is already loaded
						page = vm.searchVariants.counts[type] === RESULTS_LIMIT ? 1 : 0;
						if (!vm.scrollFetchEnabled)
							vm.scrollFetchEnabled = true;
						vm.searchBy = type;
						$state.go('.', {
							by: type
						}, {
							notify: false
						});
					}
					
					function search(type) {
						if (vm.resultsAreLoading || !vm.searchQuery)
							return;
						// disable next loading if it's last piece of data;
						if (vm.searchVariants.counts[type] < RESULTS_LIMIT) {
							vm.scrollFetchEnabled = false;
							return;
						}
						vm.resultsAreLoading = true;
						data.search.global(vm.searchQuery, type, page, RESULTS_LIMIT).then(function(results) {
							// change tab acording results
							if (!type) {
								if (!results.users.length && results.games.length) {
									vm.searchBy = 'games';
								} else if (results.users.length && !results.games.length) {
									vm.searchBy = 'users';
								}
								activateTab();
							}
							results = fixIcons(results);
							
							if (results.users && results.users.length) {
								vm.searchVariants.users = vm.searchVariants.users.concat(results.users);
								vm.searchVariants.counts.users = results.users.length;
							}
							
							if (results.games && results.games.length) {
								vm.searchVariants.games = vm.searchVariants.games.concat(results.games);
								vm.searchVariants.counts.games = results.games.length;
							}
							
							vm.resultsAreLoading = false;
							page++;
						});
					}
					
					function activateTab() {
						vm.tabs.find(function(tab) {
							return tab.url === vm.searchBy
						}).active = true;
					}
					
					function fixIcons(results) {
						if (results.users)
							results.users.forEach(function(user) {
								user.profileLogoSmall = user.profileLogoSmall || config.defaultProfileLogoSmall;
							})
						if (results.games)
							results.games.forEach(function(game) {
								game.icon = game.icon || config.defaultProfileLogoSmall;
							});
						return results;
					}
				
				}
				SearchResultsController.$inject = ["$scope", "$state", "data", "config", "utils"];
			})();
			
