			(function() {
				'use strict';
				
				angular
				.module('web')
				.controller('PasswordChangeController', PasswordChangeController);
				
				/* @ngInject */
				function PasswordChangeController(data, $location) {
					var vm = this;
					vm.validToken = false;
					vm.loaded = false;
					vm.complete = false;
					activate();
					
					vm.submit = function() {
						if (vm.form.$invalid)
							return;
						var token = $location.search().token;
						data.user.passwordResetComplete(token, vm.password).then(function(data) {
							if (data.validToken === false) {
								vm.validToken = data.validToken;
							} else if (data.app_success) {
								vm.complete = true;
							}
						})
					}
					
					////////////////
					
					function activate() {
						var token = $location.search().token;
						if (!token)
							vm.loaded = true;
						data.user.passwordResetValidate(token).then(function(data) {
							vm.loaded = true;
							vm.validToken = data.validToken;
						})
					}
				}
				PasswordChangeController.$inject = ["data", "$location"];
			})();
			
