					vm.deleteBroadcast = deleteBroadcast;
					vm.uploadCustomThumbnail = uploadCustomThumbnail;
					vm.isChannelPage = _isChannelPage;
					vm.showShareOptions = showShareOptions;
					vm.saveDescription = saveDescription;
					vm.formatUrl = utils.formatUrl;
					vm.loaded = false;
					vm.online = false;
					vm.descriptionEditable = false;
					vm.state = _state;
					vm.profileDescription = '';
					vm.embedMode = _isEmbedMode;
					vm.showLiveViewerCounts = config.showLiveViewerCounts;
					vm.editProfileDescription = editProfileDescription;
					vm.playerOptions = null ;
					$scope.$on('logged-in', fetchChannelData)
					// TODO: Remove polling- join the broadcast as a logged in user.
					$scope.$on('logged-out', fetchChannelData)
					$scope.$on('$destroy', unbind)
					$scope.$on('live:broadcast_changed', onBroadcastChanged)
					
					activate()
					function activate() {
						document.getElementById('main-content').scrollTop = 0;
						// Mild hack to reset scroll position... revisit eventually
						if (config.mobileRedirect && config.mobileRedirectType !== 'feed') {
							vm.deepLinkView = true;
						}
						// Bind all data passed in from the route.
						if (!setChannelViewBindsFromDataCallback($state.$current.locals.resolve.$$values.channel))
							return false;
						// Load the chat room for channels.
						if (_enableChat) {
							$rootScope.$broadcast('load-chat', {
								roomId: vm.channelUser.chatRoom
							})
						}
						setDescriptionText();
						vm.loaded = true;
					}
					
