			(function() {
				'use strict';
				
				angular
				.module('web')
				.factory('utils', Utils);
				
				/* @ngInject */
				function Utils(config) {
					
					var entityMap = {
						'&': '&amp;',
						'<': '&lt;',
						'>': '&gt;',
						'"': '&quot;',
						'\'': '&#39;',
						'/': '&#x2F;'
					}
					
					var service = {
						formatBroadcastUrl: formatBroadcastUrl,
						formatUrl: formatUrl,
						escapeHtml: escapeHtml,
						escapeRegex: escapeRegex,
						getBroadcastSnapshotUrl: getBroadcastSnapshotUrl,
						getChannelUrls: getChannelUrls,
						autolinker: autolinker,
						endsWith: endsWith,
						toCamelCase: toCamelCase
					};
					
					return service;
					
					////////////////
					
					function endsWith(str, suffix) {
						return str.indexOf(suffix, str.length - suffix.length) !== -1;
					}
					
					function formatBroadcastUrl(url, broadcastId, cdn, index) {
						if (url.match(/%s/g).length === 3) {
							url = url.replace(/%s/, cdn)
							url = url.replace(/%s/, index)
						}
						url = url.replace(/^https?:/, '')
						return url.replace(/%s/, broadcastId)
					}
					
					function getBroadcastSnapshotUrl(broadcast) {
						if (broadcast.hasCustomThumbnail) {
							return formatBroadcastUrl(config.videoCustomThumbnailUrl, broadcast._id);
						} else {
							return formatBroadcastUrl(config.videoSnapshotUrl, broadcast._id);
						}
					}
					
					function escapeHtml(string) {
						return string.replace(/[&<>]/g, function(s) {
							return entityMap[s];
						});
					}
					
					function escapeRegex(string) {
						return string.replace(/[\-\[\]\/\{\}\(\)\*\+\?\.\\\^\$\|]/g, '\\$&')
					}
					
					function getChannelUrls(webHost, channelUrl, broadcastId) {
						return {
							channelEmbed: 'http://' + webHost + '/' + channelUrl + '/embed',
							channelChat: 'http://' + webHost + '/' + channelUrl + '/chat',
							broadcastEmbed: 'http://' + webHost + '/' + channelUrl + '/p/' + broadcastId,
							channel: 'http://' + webHost + '/' + channelUrl
						}
					}
					
					function formatUrl(url) {
						return url.replace(/^https?:/, '')
					}
					
					function toCamelCase(str) {
						if (str.length === 0) {
							return '';
						}
						return '' + (str.substr(0, 1).toUpperCase()) + (str.substr(1));
					}
					
					function autolinker(text, allowAllLinks) {
						var linkedText = Autolinker.link(text, {
							twitter: false,
							replaceFn: function(autolinker, match) {
								if (allowAllLinks)
									return true;
								var host;
								try {
									host = new URL(match.getUrl()).host
								} 
								catch (err) {
									return false;
								}
								if (!host)
									return false;
								var matched = false;
								angular.forEach(config.domainWhiteList, function(whitelistDomain) {
									if (endsWith(host, whitelistDomain)) {
										matched = true;
										return false;
									}
								})
								if (matched)
									return autolinker.getTagBuilder().build(match);
								return false;
							}
						});
						
						return linkedText;
					}
				}
				Utils.$inject = ["config"];
			})();
			
