							'Chat Messages Sent': 0,
							'Like': 0,
							'Follow': 0,
							// 'Share Facebook': 0, // no implementation
							// 'Share Twitter': 0,// no implementation
							// 'Share Mobcrush': 0, // no implementation
							'Duration': 0,
							'Full Screen Duration': 0,
							'Local Start Time (Hour)': now.getHours(),
