			(function() {
				'use strict';
				
				angular
				.module('web')
				.controller('UploadModalController', UploadModalController)
				
				function UploadModalController(// jshint ignore:line
				$scope, notify, data, broadcast, $uibModalInstance, user, mode
				) {
					
					var _maxFileSize = 3250585;
					
					var vm = this;
					vm.uploadFile = uploadFile;
					if (broadcast)
						vm.broadcast = broadcast;
					
					function uploadFile() {
						var file = document.getElementById('file').files[0];
						var fd = new FormData();
						
						if (file.type !== 'image/png' && file.type !== 'image/jpeg') {
							notify.push({
								type: 'error',
								message: 'File must be in either .jpg or .png format.'
							});
							return;
						}
						
						if (file.size > _maxFileSize) {
							notify.push({
								type: 'error',
								message: 'File size must be under 3MB.'
							})
							return;
						}
						
						fd.append('file', file);
						
						if (mode === 'broadcast-thumbnail')
							uploadBroadcastThumbnail(fd);
						else if (mode === 'profile-photo')
							uploadProfilePhoto(fd);
					}
					
					function uploadProfilePhoto(fileData) {
						data.user.updateUserPhoto(fileData).then(function(res) {
							if (res.status === 'OK') {
								notify.push({
									type: 'success',
									message: 'Profile photo updated! You look great!'
								})
								user.get().profileLogoSmall = res.profileLogoSmall
								$scope.$emit('profile-photo-uploaded');
							} else {
								notify.push({
									type: 'error',
									key: 'ERROR_GENERAL'
								})
							}
							
							$uibModalInstance.close()
						})
					}
					
					function uploadBroadcastThumbnail(fileData) {
						data.broadcast.updateThumbnail(fileData, vm.broadcast._id).then(function(res) {
							if (res.status === 'OK') {
								notify.push({
									type: 'success',
									message: 'Thumbnail photo updated!'
								})
							} else {
								notify.push({
									type: 'error',
									key: 'ERROR_GENERAL'
								})
							}
							
							$uibModalInstance.close();
						})
					}
				}
				UploadModalController.$inject = ["$scope", "notify", "data", "broadcast", "$uibModalInstance", "user", "mode"];
			})();
			
