			(function() {
				'use strict'
				
				angular
				.module('web')
				.controller('ListController', ListController);
				
				function ListController($state, $scope, data, utils) {
					var vm = this;
					var routePrep = $state.$current.locals.resolve.$$values.list;
					
					var _gamesPageSize = 61;
					activate();
					
					if ($state.current.data && $state.current.data.filter) {
						vm.filter = $state.current.data.filter;
						vm.fetchEnabled = true;
					}
					
					$scope.$on('set-list-filter', function(ev, filter) {
						activate()
						vm.filter = filter;
						if (vm.filter.routePrep) {
							routePrep = vm.filter.routePrep
						}
						vm.fetchEnabled = true;
						vm.fetch();
					})
					
					vm.fetch = function() {
						if (!vm.fetchEnabled)
							return;
						
						if (vm.index === 0 && angular.isArray(routePrep) && routePrep.length > 0) {
							vm.list = routePrep;
							vm.index++;
							return;
						}
						vm.fetchEnabled = false;
						if (vm.filter.category === 'new') {
							data.broadcast.getRecent(vm.index).then(done);
						} else if (vm.filter.channelId) {
							
							data.broadcast.getByChannel(vm.filter.channelId, vm.index).then(done);
						} else if (vm.filter.gameId) {
							vm.filter.category = 'games';
							data.broadcast.getByGame(vm.filter.gameId, vm.index).then(done);
						} else if (vm.filter.category === 'partnerBroadcasts') {
							data.broadcast.getRecentByPartners(vm.index).then(done);
						} else if (vm.filter.category === 'popular') {
							data.broadcast.getPopular(vm.index).then(done);
						} else if (vm.filter.category === 'games') {
							data.games.get(vm.index, _gamesPageSize).then(done);
						} else if (vm.filter.category === 'following') {
							data.broadcast.getUserFollowing(vm.index).then(done);
						}
					}
					
					function done(data) {
						if (data.length > 0) {
							vm.list = vm.list.concat(data);
							vm.index++;
							vm.fetchEnabled = true;
						}
					}
					
					function activate() {
						vm.filter = null ;
						vm.fetchEnabled = false;
						vm.list = [];
						vm.index = 0;
					}
					return vm;
				}
				ListController.$inject = ["$state", "$scope", "data", "utils"];
			})();
			
			(function() {
				'use strict';
				
				angular
				.module('web')
				.controller('GlobalSearchController', GlobalSearchController);
				
				/* @ngInject */
				function GlobalSearchController($scope, $state, data, config, utils) {
					var vm = this;
					vm.searchString = null ;
					vm.searchVariants = null ;
					vm.search = search;
					vm.selectSearchMatch = selectSearchMatch;
					vm.goToAllResults = goToAllResults;
					var SEARCH_RESULTS_LIMIT = 5;
					
					function search() {
						if (!vm.searchString) {
							vm.searchVariants = null ;
							return;
						}
						
						data.search.global(vm.searchString, null , 0, SEARCH_RESULTS_LIMIT).then(function(data) {
							if (!vm.searchString) {
								vm.searchVariants = null ;
								return;
							}
							//fix users icon
							data.users.forEach(function(user) {
								user.profileLogoSmall = user.profileLogoSmall || config.defaultProfileLogoSmall;
							});
							
							//fix games icon
							data.games.forEach(function(game) {
								game.icon = game.icon || config.defaultProfileLogoSmall;
							});
							
							if (data.users.length || data.games.length)
								data.data = true;
							vm.searchVariants = data;
						});
					}
					
					function selectSearchMatch(item, type) {
						switch (type) {
						case 'game':
							$state.go('game', {
								game: item.lowerUrl
							});
							$scope.$emit('search', vm.searchString, 'Game', item.name);
							break;
						case 'user':
							$state.go('channel', {
								channel: item.primaryChannel.lowerUrl
							});
							$scope.$emit('search', vm.searchString, 'User', item.username);
							break;
						case 'all':
							$state.go('searchResults', {
								query: vm.searchString
							});
							break;
						}
						vm.searchVariants = null ;
						vm.searchString = '';
					}
					
					function goToAllResults(type) {
						$state.go('searchResults', {
							by: type,
							query: vm.searchString
						});
						vm.searchVariants = null ;
						vm.searchString = null ;
					}
				}
				GlobalSearchController.$inject = ["$scope", "$state", "data", "config", "utils"];
			})();
			
			(function() {
				'use strict'
				
				angular
				.module('web')
				.controller('GamesSearchController', GamesSearchController);
				
				function GamesSearchController($state, $scope, data) {
					var vm = this;
					var isLoading = false;
					var searchPromise = null ;
					var searchStr = '';
					vm.searchForTypeAhead = function(searchString) {
						isLoading = true;
						searchStr = searchString;
						searchPromise = data.games.search('^' + searchString, true, 10);
						return searchPromise;
					}
					;
					
					vm.typeAheadSelect = function($item, $model, $label) {
						$scope.$emit('search', searchStr, 'Game', $item.name);
						$state.go('game', {
							game: $item.lowerUrl
						});
					}
					;
					
					vm.goToFirstResult = function() {
						if (isLoading)
							searchPromise.then(function(data) {
								if (data.length)
									vm.typeAheadSelect(data[0]);
							})
					}
				}
				GamesSearchController.$inject = ["$state", "$scope", "data"];
			})();
			
