						var el = $el[0];
						var _glued = true;
						var _timeout = false;
						
						window.addEventListener('resize', ensureRemainsGlued, false);
						$el.bind('scroll', scrollHandler);
						$el.bind('DOMNodeInserted', nodeAdded);
						$el.bind('DOMNodeRemoved', nodeRemoved);
						scope.$on('$destroy', unbind)
